/* WARNING: Script requires that SQLITE_DBCONFIG_DEFENSIVE be disabled */
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE gpkg_spatial_ref_sys (srs_name TEXT NOT NULL,srs_id INTEGER NOT NULL PRIMARY KEY,organization TEXT NOT NULL,organization_coordsys_id INTEGER NOT NULL,definition  TEXT NOT NULL,description TEXT);
CREATE TABLE gpkg_contents (table_name TEXT NOT NULL PRIMARY KEY,data_type TEXT NOT NULL,identifier TEXT UNIQUE,description TEXT DEFAULT '',last_change DATETIME NOT NULL DEFAULT (strftime('%Y-%m-%dT%H:%M:%fZ','now')),min_x DOUBLE, min_y DOUBLE,max_x DOUBLE, max_y DOUBLE,srs_id INTEGER,CONSTRAINT fk_gc_r_srs_id FOREIGN KEY (srs_id) REFERENCES gpkg_spatial_ref_sys(srs_id));
CREATE TABLE gpkg_ogr_contents(table_name TEXT NOT NULL PRIMARY KEY,feature_count INTEGER DEFAULT NULL);
CREATE TABLE gpkg_geometry_columns (table_name TEXT NOT NULL,column_name TEXT NOT NULL,geometry_type_name TEXT NOT NULL,srs_id INTEGER NOT NULL,z TINYINT NOT NULL,m TINYINT NOT NULL,CONSTRAINT pk_geom_cols PRIMARY KEY (table_name, column_name),CONSTRAINT uk_gc_table_name UNIQUE (table_name),CONSTRAINT fk_gc_tn FOREIGN KEY (table_name) REFERENCES gpkg_contents(table_name),CONSTRAINT fk_gc_srs FOREIGN KEY (srs_id) REFERENCES gpkg_spatial_ref_sys (srs_id));
CREATE TABLE gpkg_tile_matrix_set (table_name TEXT NOT NULL PRIMARY KEY,srs_id INTEGER NOT NULL,min_x DOUBLE NOT NULL,min_y DOUBLE NOT NULL,max_x DOUBLE NOT NULL,max_y DOUBLE NOT NULL,CONSTRAINT fk_gtms_table_name FOREIGN KEY (table_name) REFERENCES gpkg_contents(table_name),CONSTRAINT fk_gtms_srs FOREIGN KEY (srs_id) REFERENCES gpkg_spatial_ref_sys (srs_id));
CREATE TABLE gpkg_tile_matrix (table_name TEXT NOT NULL,zoom_level INTEGER NOT NULL,matrix_width INTEGER NOT NULL,matrix_height INTEGER NOT NULL,tile_width INTEGER NOT NULL,tile_height INTEGER NOT NULL,pixel_x_size DOUBLE NOT NULL,pixel_y_size DOUBLE NOT NULL,CONSTRAINT pk_ttm PRIMARY KEY (table_name, zoom_level),CONSTRAINT fk_tmm_table_name FOREIGN KEY (table_name) REFERENCES gpkg_contents(table_name));
CREATE TABLE IF NOT EXISTS "test_land" ( "fid" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "geography" GEOMETRY, "path" TEXT NOT NULL, "area_land" INTEGER, "area_water" INTEGER);
CREATE TABLE gpkg_extensions (table_name TEXT,column_name TEXT,extension_name TEXT NOT NULL,definition TEXT NOT NULL,scope TEXT NOT NULL,CONSTRAINT ge_tce UNIQUE (table_name, column_name, extension_name));
PRAGMA writable_schema=ON;
CREATE TABLE IF NOT EXISTS "rtree_test_land_geography_rowid"(rowid INTEGER PRIMARY KEY,nodeno);
CREATE TABLE IF NOT EXISTS "rtree_test_land_geography_node"(nodeno INTEGER PRIMARY KEY,data);
CREATE TABLE IF NOT EXISTS "rtree_test_land_geography_parent"(nodeno INTEGER PRIMARY KEY,parentnode);
CREATE TABLE IF NOT EXISTS "test_land__internal_points" ( "fid" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "internal_point" POINT, "path" TEXT NOT NULL);
CREATE TABLE IF NOT EXISTS "rtree_test_land__internal_points_internal_point_rowid"(rowid INTEGER PRIMARY KEY,nodeno);
CREATE TABLE IF NOT EXISTS "rtree_test_land__internal_points_internal_point_node"(nodeno INTEGER PRIMARY KEY,data);
CREATE TABLE IF NOT EXISTS "rtree_test_land__internal_points_internal_point_parent"(nodeno INTEGER PRIMARY KEY,parentnode);
CREATE TABLE gerrydb_view_meta (
            key   TEXT PRIMARY KEY,
            value TEXT NOT NULL
        );
CREATE TABLE gerrydb_geo_meta (
            meta_id INTEGER PRIMARY KEY,
            value   TEXT    NOT NULL
        );
CREATE TABLE gerrydb_geo_attrs (
            path        TEXT PRIMARY KEY REFERENCES test_land(path),
            meta_id     BLOB NOT NULL    REFERENCES gerrydb_geo_meta(meta_id),
            valid_from  TEXT
        );
CREATE TABLE gpkg_data_columns (
            table_name TEXT NOT NULL,
            column_name TEXT NOT NULL,
            name TEXT,
            title TEXT,
            description TEXT,
            mime_type TEXT,
            constraint_name TEXT,
            CONSTRAINT pk_gdc PRIMARY KEY (table_name, column_name),
            CONSTRAINT gdc_tn UNIQUE (table_name, name)
        );
CREATE TRIGGER 'gpkg_tile_matrix_zoom_level_insert' BEFORE INSERT ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'insert on table ''gpkg_tile_matrix'' violates constraint: zoom_level cannot be less than 0') WHERE (NEW.zoom_level < 0); END;
CREATE TRIGGER 'gpkg_tile_matrix_zoom_level_update' BEFORE UPDATE of zoom_level ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'update on table ''gpkg_tile_matrix'' violates constraint: zoom_level cannot be less than 0') WHERE (NEW.zoom_level < 0); END;
CREATE TRIGGER 'gpkg_tile_matrix_matrix_width_insert' BEFORE INSERT ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'insert on table ''gpkg_tile_matrix'' violates constraint: matrix_width cannot be less than 1') WHERE (NEW.matrix_width < 1); END;
CREATE TRIGGER 'gpkg_tile_matrix_matrix_width_update' BEFORE UPDATE OF matrix_width ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'update on table ''gpkg_tile_matrix'' violates constraint: matrix_width cannot be less than 1') WHERE (NEW.matrix_width < 1); END;
CREATE TRIGGER 'gpkg_tile_matrix_matrix_height_insert' BEFORE INSERT ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'insert on table ''gpkg_tile_matrix'' violates constraint: matrix_height cannot be less than 1') WHERE (NEW.matrix_height < 1); END;
CREATE TRIGGER 'gpkg_tile_matrix_matrix_height_update' BEFORE UPDATE OF matrix_height ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'update on table ''gpkg_tile_matrix'' violates constraint: matrix_height cannot be less than 1') WHERE (NEW.matrix_height < 1); END;
CREATE TRIGGER 'gpkg_tile_matrix_pixel_x_size_insert' BEFORE INSERT ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'insert on table ''gpkg_tile_matrix'' violates constraint: pixel_x_size must be greater than 0') WHERE NOT (NEW.pixel_x_size > 0); END;
CREATE TRIGGER 'gpkg_tile_matrix_pixel_x_size_update' BEFORE UPDATE OF pixel_x_size ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'update on table ''gpkg_tile_matrix'' violates constraint: pixel_x_size must be greater than 0') WHERE NOT (NEW.pixel_x_size > 0); END;
CREATE TRIGGER 'gpkg_tile_matrix_pixel_y_size_insert' BEFORE INSERT ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'insert on table ''gpkg_tile_matrix'' violates constraint: pixel_y_size must be greater than 0') WHERE NOT (NEW.pixel_y_size > 0); END;
CREATE TRIGGER 'gpkg_tile_matrix_pixel_y_size_update' BEFORE UPDATE OF pixel_y_size ON 'gpkg_tile_matrix' FOR EACH ROW BEGIN SELECT RAISE(ABORT, 'update on table ''gpkg_tile_matrix'' violates constraint: pixel_y_size must be greater than 0') WHERE NOT (NEW.pixel_y_size > 0); END;
CREATE TRIGGER "rtree_test_land_geography_insert" AFTER INSERT ON "test_land" WHEN (new."geography" NOT NULL AND NOT ST_IsEmpty(NEW."geography")) BEGIN INSERT OR REPLACE INTO "rtree_test_land_geography" VALUES (NEW."fid",ST_MinX(NEW."geography"), ST_MaxX(NEW."geography"),ST_MinY(NEW."geography"), ST_MaxY(NEW."geography")); END;
CREATE TRIGGER "rtree_test_land_geography_update1" AFTER UPDATE OF "geography" ON "test_land" WHEN OLD."fid" = NEW."fid" AND (NEW."geography" NOTNULL AND NOT ST_IsEmpty(NEW."geography")) BEGIN INSERT OR REPLACE INTO "rtree_test_land_geography" VALUES (NEW."fid",ST_MinX(NEW."geography"), ST_MaxX(NEW."geography"),ST_MinY(NEW."geography"), ST_MaxY(NEW."geography")); END;
CREATE TRIGGER "rtree_test_land_geography_update2" AFTER UPDATE OF "geography" ON "test_land" WHEN OLD."fid" = NEW."fid" AND (NEW."geography" ISNULL OR ST_IsEmpty(NEW."geography")) BEGIN DELETE FROM "rtree_test_land_geography" WHERE id = OLD."fid"; END;
CREATE TRIGGER "rtree_test_land_geography_update3" AFTER UPDATE ON "test_land" WHEN OLD."fid" != NEW."fid" AND (NEW."geography" NOTNULL AND NOT ST_IsEmpty(NEW."geography")) BEGIN DELETE FROM "rtree_test_land_geography" WHERE id = OLD."fid"; INSERT OR REPLACE INTO "rtree_test_land_geography" VALUES (NEW."fid",ST_MinX(NEW."geography"), ST_MaxX(NEW."geography"),ST_MinY(NEW."geography"), ST_MaxY(NEW."geography")); END;
CREATE TRIGGER "rtree_test_land_geography_update4" AFTER UPDATE ON "test_land" WHEN OLD."fid" != NEW."fid" AND (NEW."geography" ISNULL OR ST_IsEmpty(NEW."geography")) BEGIN DELETE FROM "rtree_test_land_geography" WHERE id IN (OLD."fid", NEW."fid"); END;
CREATE TRIGGER "rtree_test_land_geography_delete" AFTER DELETE ON "test_land" WHEN old."geography" NOT NULL BEGIN DELETE FROM "rtree_test_land_geography" WHERE id = OLD."fid"; END;
CREATE TRIGGER "trigger_insert_feature_count_test_land" AFTER INSERT ON "test_land" BEGIN UPDATE gpkg_ogr_contents SET feature_count = feature_count + 1 WHERE lower(table_name) = lower('test_land'); END;
CREATE TRIGGER "trigger_delete_feature_count_test_land" AFTER DELETE ON "test_land" BEGIN UPDATE gpkg_ogr_contents SET feature_count = feature_count - 1 WHERE lower(table_name) = lower('test_land'); END;
CREATE TRIGGER "rtree_test_land__internal_points_internal_point_insert" AFTER INSERT ON "test_land__internal_points" WHEN (new."internal_point" NOT NULL AND NOT ST_IsEmpty(NEW."internal_point")) BEGIN INSERT OR REPLACE INTO "rtree_test_land__internal_points_internal_point" VALUES (NEW."fid",ST_MinX(NEW."internal_point"), ST_MaxX(NEW."internal_point"),ST_MinY(NEW."internal_point"), ST_MaxY(NEW."internal_point")); END;
CREATE TRIGGER "rtree_test_land__internal_points_internal_point_update1" AFTER UPDATE OF "internal_point" ON "test_land__internal_points" WHEN OLD."fid" = NEW."fid" AND (NEW."internal_point" NOTNULL AND NOT ST_IsEmpty(NEW."internal_point")) BEGIN INSERT OR REPLACE INTO "rtree_test_land__internal_points_internal_point" VALUES (NEW."fid",ST_MinX(NEW."internal_point"), ST_MaxX(NEW."internal_point"),ST_MinY(NEW."internal_point"), ST_MaxY(NEW."internal_point")); END;
CREATE TRIGGER "rtree_test_land__internal_points_internal_point_update2" AFTER UPDATE OF "internal_point" ON "test_land__internal_points" WHEN OLD."fid" = NEW."fid" AND (NEW."internal_point" ISNULL OR ST_IsEmpty(NEW."internal_point")) BEGIN DELETE FROM "rtree_test_land__internal_points_internal_point" WHERE id = OLD."fid"; END;
CREATE TRIGGER "rtree_test_land__internal_points_internal_point_update3" AFTER UPDATE ON "test_land__internal_points" WHEN OLD."fid" != NEW."fid" AND (NEW."internal_point" NOTNULL AND NOT ST_IsEmpty(NEW."internal_point")) BEGIN DELETE FROM "rtree_test_land__internal_points_internal_point" WHERE id = OLD."fid"; INSERT OR REPLACE INTO "rtree_test_land__internal_points_internal_point" VALUES (NEW."fid",ST_MinX(NEW."internal_point"), ST_MaxX(NEW."internal_point"),ST_MinY(NEW."internal_point"), ST_MaxY(NEW."internal_point")); END;
CREATE TRIGGER "rtree_test_land__internal_points_internal_point_update4" AFTER UPDATE ON "test_land__internal_points" WHEN OLD."fid" != NEW."fid" AND (NEW."internal_point" ISNULL OR ST_IsEmpty(NEW."internal_point")) BEGIN DELETE FROM "rtree_test_land__internal_points_internal_point" WHERE id IN (OLD."fid", NEW."fid"); END;
CREATE TRIGGER "rtree_test_land__internal_points_internal_point_delete" AFTER DELETE ON "test_land__internal_points" WHEN old."internal_point" NOT NULL BEGIN DELETE FROM "rtree_test_land__internal_points_internal_point" WHERE id = OLD."fid"; END;
CREATE TRIGGER "trigger_insert_feature_count_test_land__internal_points" AFTER INSERT ON "test_land__internal_points" BEGIN UPDATE gpkg_ogr_contents SET feature_count = feature_count + 1 WHERE lower(table_name) = lower('test_land__internal_points'); END;
CREATE TRIGGER "trigger_delete_feature_count_test_land__internal_points" AFTER DELETE ON "test_land__internal_points" BEGIN UPDATE gpkg_ogr_contents SET feature_count = feature_count - 1 WHERE lower(table_name) = lower('test_land__internal_points'); END;
CREATE UNIQUE INDEX idx_geo_path ON test_land(path);
CREATE UNIQUE INDEX idx_internal_point_path ON test_land__internal_points(path);
PRAGMA writable_schema=OFF;
COMMIT;
